<script>
(function () {
  'use strict';
  $("#search-text").keyup(function() {
    milo.filter($("#search-content"), $(this).val());
  });
  const q = milo.getUrlParameter("q").replace("+", " ");
  if (q) {
    $("#search-text").val(q).trigger("keyup");
  }
})();
</script>
